import axios from 'axios';

export default class Server {

    async signInUser(data) {
        const _res = await axios.post("https://nodejs-test-api-blog.herokuapp.com/api/v1/auth", data);
        if (_res) {
            console.log('üëâ Returned data:', _res);
        } else {
            console.log(`üò± Axios request failed: ${_res.status}`);
        }

        return await _res
    }
}
